import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import axios from "axios";

export default function PRDetails() {
  const { owner, repo, number } = useParams();
  const [prData, setPrData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const token = localStorage.getItem("authToken");

  useEffect(() => {
    const fetchPRDetails = async () => {
      // Validate route params
      if (!owner || !repo || !number) {
        console.error("Missing params:", { owner, repo, number });
        setError("Invalid PR URL — missing parameters.");
        setLoading(false);
        return;
      }

      // Build full API URL
      const apiUrl = `${process.env.REACT_APP_API_URL}/repos/${owner}/${repo}/pulls/${number}/details`;

      // Log for debugging
      console.log("Fetching PR details from:", apiUrl);
      console.log("Auth token:", token ? "Present" : "Missing");

      try {
        const res = await axios.get(apiUrl, {
          headers: { Authorization: `Bearer ${token}` },
        });
        setPrData(res.data);
      } catch (err) {
        console.error("Error fetching PR details:", err);
        setError(
          err.response?.status === 404
            ? "Pull Request not found on server."
            : "Unable to fetch pull request details. Please try again."
        );
      } finally {
        setLoading(false);
      }
    };

    fetchPRDetails();
  }, [owner, repo, number, token]);

  const renderDiff = (patch) => {
    if (!patch) return <p className="text-gray-500">No diff available</p>;
    return patch.split("\n").map((line, idx) => {
      let bgClass = "";
      if (line.startsWith("+") && !line.startsWith("+++")) {
        bgClass = "bg-green-100 text-green-800";
      } else if (line.startsWith("-") && !line.startsWith("---")) {
        bgClass = "bg-red-100 text-red-800";
      } else {
        bgClass = "bg-gray-100 text-gray-800";
      }
      return (
        <div
          key={idx}
          className={`whitespace-pre-wrap font-mono text-sm px-2 py-0.5 ${bgClass}`}
        >
          {line}
        </div>
      );
    });
  };

  if (loading) return <p className="p-4">Loading PR details...</p>;
  if (error) return <p className="p-4 text-red-600">{error}</p>;
  if (!prData) return <p className="p-4">No PR details found.</p>;

  return (
    <div className="p-4 max-w-5xl mx-auto">
      {/* PR Header */}
      <div className="border-b pb-3 mb-4">
        <h1 className="text-2xl font-bold">{prData.details.title}</h1>
        <p className="text-gray-600">
          Status: <span className="font-medium">{prData.details.state}</span> •
          Author: {prData.details.user.login} • Created:{" "}
          {new Date(prData.details.created_at).toLocaleString()}
        </p>
      </div>

      {/* Commits */}
      <h2 className="text-lg font-semibold mb-2">Commits</h2>
      {prData.commits.length === 0 ? (
        <p className="text-gray-500 mb-6">No commits found for this PR.</p>
      ) : (
        <ul className="list-disc pl-5 mb-6">
          {prData.commits.map((commit) => (
            <li key={commit.sha}>
              <a
                href={commit.html_url}
                target="_blank"
                rel="noopener noreferrer"
                className="text-blue-600 hover:underline"
              >
                {commit.commit.message}
              </a>{" "}
              — {commit.commit.author.name}
            </li>
          ))}
        </ul>
      )}

      {/* Files Changed */}
      <h2 className="text-lg font-semibold mb-2">Files Changed</h2>
      {prData.files.length === 0 ? (
        <p className="text-gray-500">No files changed.</p>
      ) : (
        prData.files.map((file, index) => (
          <details
            key={file.filename}
            className="mb-4 border rounded overflow-hidden"
          >
            <summary className="bg-gray-200 px-3 py-2 font-medium border-b cursor-pointer">
              {index + 1}. {file.filename}{" "}
              <span className="text-sm text-gray-600">
                (+{file.additions} / -{file.deletions})
              </span>
            </summary>
            <div className="overflow-x-auto">{renderDiff(file.patch)}</div>
          </details>
        ))
      )}
    </div>
  );
}
